INSERT INTO `cfclassschemedescr` VALUES (1,'This scheme contains defined CERIF concepts such as person, organisation, research infrastructure (being not only a 1:1 representation of the CERIF entities), but even more, e.g. research infrastructure subsumes facilty, equipment and service and output subsumes publication, patent, and product in CERIF.',NULL,'ORIGINAL','en',1),(2,'This scheme implies the CERIF vocabulary terms applicable with intra-entity sturctures - such as Part in e.g. link entities such as cfOrganisationUnit_OrganisationUnit; cfProject_Project.',NULL,'ORIGINAL','en',2),(3,'The personal honorific titles (may be more than one).',NULL,'ORIGINAL','en',3),(4,'The level of degree a person is studying for.',NULL,'ORIGINAL','en',4),(5,'This scheme contains CERIF vocabulary terms applicable in the cfPerson_Person link entity, being thus an interpersonal structure. ',NULL,'ORIGINAL','en',5),(6,'This scheme contains CERIF vocabulary terms applicable in the cfOrganisationUnit_OrganisationUnit link entity, being thus an inter-organisational structure.',NULL,'ORIGINAL','en',6),(7,'This scheme contains CERIF vocabulary terms applicable in a cfResultPublication_ResultPublication link entity, being thus an inter-publication relations.',NULL,'ORIGINAL','en',7),(8,'This scheme contains CERIF vocabulary terms applicable in a cfResultPatent_ResultPatent link entity, being thus an inter-patent relation.',NULL,'ORIGINAL','en',8),(9,'This scheme contains CERIF vocabulary terms applicable in a cfResultProduct_ResultProduct link entity, being thus an inter-product relations.',NULL,'ORIGINAL','en',9),(10,'This scheme contains CERIF vocabulary terms applicable in a cfEvent_Event link entity, being thus an inter-event relations.',NULL,'ORIGINAL','en',10),(11,'This scheme contains CERIF vocabulary terms applicable in a cfFacility_Facility link entity, being thus an inter-facility relations.',NULL,'ORIGINAL','en',11),(12,'This scheme contains CERIF vocabulary terms applicable in a cfEquipment_Equipment link entity, being thus an inter-equipment relations.',NULL,'ORIGINAL','en',12),(13,'This scheme contains CERIF vocabulary terms applicable in a cfService_Service link entity, being thus an inter-service relations.',NULL,'ORIGINAL','en',13),(14,'This scheme contains CERIF vocabulary terms applicable in e.g. a cfResultPublication_ResultPatent; cfResultPublication_ResultProduct link entity, being thus an inter-output relations. The type of relationships between two outputs (e.g publication and data).',NULL,'ORIGINAL','en',14),(15,'This scheme contains CERIF vocabulary terms applicable in a cfProject_Project link entity, being thus an activity structure. ',NULL,'ORIGINAL','en',15),(16,'This scheme contains CERIF vocabulary terms applicable in e.g. the cfProject_ResultPublication; cfProject_ResultPatent; cfProject_ResultProduct; cfProject_Event cflink entity, being thus an activity output contribution. ',NULL,'ORIGINAL','en',16),(17,'The type of cost of an activity.',NULL,'ORIGINAL','en',17),(18,'The income or expenditure (actual, committed or budgeted) against a finance category for the activity (Research project). ',NULL,'ORIGINAL','en',18),(19,'This scheme contains CERIF vocabulary terms applicable in a cfProject_ResultPublication link entity - being thus project publication roles. ',NULL,'ORIGINAL','en',19),(20,'This scheme contains CERIF vocabulary terms applicable in project initiated results, such as citations or spin-offs, e.g. recorded through the cfProject_OrganisationUnit link entity or with citation counting, being thus project outcome relations.',NULL,'ORIGINAL','en',20),(21,'This scheme contains CERIF vocabulary terms applicable in the cfProject_Equipment; cfProject_Service, cfProject_Facility link entities, being thus project infrastructure relation.',NULL,'ORIGINAL','en',21),(22,'This scheme contains CERIF vocabulary terms applicable in the cfOrgUnit_Funding link entity, being thus organisation funding roles.',NULL,'ORIGINAL','en',22),(23,'This scheme contains CERIF vocabulary terms applicable in the cfProject_OrganisationUnit link entity - being thus an organisation\'s project engagement.',NULL,'ORIGINAL','en',23),(24,'This scheme contains CERIF vocabulary terms applicable in the cfOrganisationUnit_ResultPublication link entity, being thus an organisation\'s output contribution.',NULL,'ORIGINAL','en',24),(25,'This scheme contains CERIF vocabulary terms applicable in the cfOrganisationUnit_ResultPublication link entity, being used as a vocabulary of organisation output roles - different from organisation output contribution.',NULL,'ORIGINAL','en',25),(26,'This scheme contains CERIF vocabulary terms applicable in the cfOrganisationUnit_Equipment; cfOrganisationUnit_Service, cfOrganisationUnit_Facility link entities, being thus organisation infrastructure roles.',NULL,'ORIGINAL','en',26),(27,'This scheme contains CERIF vocabulary terms applicable with the cfOrganisationUnit_Measurement entity, being thus organisation related measurements, such as e.g. cost center.',NULL,'ORIGINAL','en',27),(28,'An organisation\'s electronic and postal contact coordinates. This scheme contains CERIF vocabulary terms applicable in the cfOrganisationUnit_ElectroniAddress or cfOrganisationUnit_PostAddress link entity, being thus organisation contact details. ',NULL,'ORIGINAL','en',28),(29,'This scheme contains CERIF vocabulary terms applicable with the cfPersonName_Person link entity, being thus a vocabulary of person name variants.',NULL,'ORIGINAL','en',29),(30,'This scheme contains CERIF vocabulary terms applicable in the cfPerson_Equipment; cfPerson_Service, cfPerson_Facility link entities, being thus person infrastructure roles.',NULL,'ORIGINAL','en',30),(31,'This scheme contains CERIF vocabulary terms applicable in the cfPerson_OrganisationUnit link entity with respect to employment, being thus employment types.',NULL,'ORIGINAL','en',31),(32,'This scheme contains CERIF vocabulary terms applicable in the cfPerson_OrganisationUnit link entity without further specification, being thus Person Organisation Roles.',NULL,'ORIGINAL','en',32),(33,'This scheme contains CERIF vocabulary terms applicable in the cfPerson_Event link entity being thus person event involvements. ',NULL,'ORIGINAL','en',33),(34,'This scheme contains CERIF vocabulary terms applicable in the cfProject_Person link entity with respect to person project engagement.',NULL,'ORIGINAL','en',34),(35,'This scheme contains CERIF vocabulary terms applicable in the cfPerson_ResultPublication link entity - being person output contribution.',NULL,'ORIGINAL','en',35),(36,'This scheme contains CERIF vocabulary terms applicable in the cfPerson_Funding link entity, being thus person funding roles such as manager or contact, where funding subsumes funding programme, tender, call, and not the income as such, which would be a financial means and as such in CERIF be a measurement.',NULL,'ORIGINAL','en',36),(37,'A person\'s electronic and postal contact coordinates. This scheme contains CERIF vocabulary terms applicable in the cfPerson_ElectroniAddress or cfPerson_PostAddress link entity, being thus person contact details.',NULL,'ORIGINAL','en',37),(38,'This scheme defines the CERIF concept of \"Research Output\" composed through the link entities cfResultPublication_Classification, cfResultPatent_Classification, cfResultProduct_Classification',NULL,'ORIGINAL','en',38),(39,'This scheme contains CERIF vocabulary terms applicable in the cfResultPublication_Equipment; cfResultPublication_Service, cfResultPublication_Facility link entities, being thus output infrastructure relationss.',NULL,'ORIGINAL','en',39),(40,'This scheme contains CERIF vocabulary terms applicable in the cfResulsPublication_Funding link entity, being thus publication funding roles and e.g. a reference to the funding programe, because the funding concept in CERIF subsumes funding programme, tender, call, and not the income as such, which would be a financial means and as such in CERIF be a measurement.',NULL,'ORIGINAL','en',40),(41,'This scheme defines the CERIF concept of \"Research Infrastructure\" composed through the link entities cfEquipment_Classification, cfFacility_Classification, cfService_Classification',NULL,'ORIGINAL','en',41),(42,'This scheme contains CERIF vocabulary terms applicable with the cfResultPublication_Equipment; cfResultPublication_Facility; and cfResultPublication_Service link entities, being thus the documents related to access policy or terms and conditions of the Research Infrastructure.',NULL,'ORIGINAL','en',42),(43,'This scheme contains CERIF vocabulary terms applicable with the cfResultPublication_Equipment; cfResultPublication_Facility; and cfResultPublication_Service link entities, being thus the documents related to usage of the Research Infrastructure.',NULL,'ORIGINAL','en',43),(44,'This scheme contains CERIF vocabulary terms applicable in the cfFacility_Service; cfEquipment_Service; cfFacility_Equipment link entities, being thus research infrastructure relations.',NULL,'ORIGINAL','en',44),(45,'This scheme contains CERIF vocabulary terms applicable in the cfFacility_Measurement; cfEquipment_Measurement; cfService_Measurement link entities, being thus research infrastructure costing.',NULL,'ORIGINAL','en',45),(46,'This scheme contains CERIF vocabulary terms applicable in the cfFunding_Equipment; cfFunding_Service, cfFunding_Facility link entities, being thus funding infrastructure roles.',NULL,'ORIGINAL','en',46),(47,'This scheme contains CERIF vocabulary terms applicable in the cfResultPublication_Funding link entity, being thus funding source document, assuming the funding concept in CERIF subsumes funding programme, tender, call, and not the income as such, which would be a financial means and as such in CERIF be a measurement.',NULL,'ORIGINAL','en',47),(48,'This scheme contains CERIF vocabulary terms applicable in the cfFederatedIdentifier_Service link entity, being thus a vocabulary of roles within the relation of identification service providers, e.g. Issuer.',NULL,'ORIGINAL','en',48),(49,'This scheme contains CERIF vocabulary terms applicable in the cfEquipment_Classification; cfFacility_Classification; cfService_Classification link entities, being thus research infrastructure states. ',NULL,'ORIGINAL','en',49),(50,'This scheme contains CERIF vocabulary terms applicable in the cfProject_Classification link entity, being thus Activity states. ',NULL,'ORIGINAL','en',50),(51,'This scheme contains CERIF vocabulary terms applicable in the cfEquipment_Classification, cfService_Classification, cfFacility_Classification link entities, being thus infrastructure types.',NULL,'ORIGINAL','en',51),(52,'This scheme contains CERIF vocabulary terms applicable in the cfResultPublication_Classification, cfResultPatent_Classification, cfResultProduct_Classification, cfEvent_Class link entities, being thus output types.',NULL,'ORIGINAL','en',52),(53,'This scheme contains CERIF vocabulary terms applicable in the cfOrganisationUnit_Classification link entity, being thus organisation types.',NULL,'ORIGINAL','en',53),(54,'The types of funding organisations defined by HESA: http://www.ref.ac.uk/media/ref/content/subguide/01_12a.pdf (page 11)',NULL,'ORIGINAL','en',54),(55,'This scheme contains CERIF vocabulary terms applicable in the cfEvent_Classification link entity, being thus event types.',NULL,'ORIGINAL','en',55),(56,'This scheme contains CERIF vocabulary terms applicable in the cfFederatedIdentifier_Classification link entity, being thus a vocabulary of current authority identifiers (extensible and meant as a first start).',NULL,'ORIGINAL','en',56),(57,'This scheme contains CERIF vocabulary terms applicable in the cfFund_Classification link entity, being thus Funding source types.',NULL,'ORIGINAL','en',57),(58,'This scheme contains CERIF vocabulary terms applicable in the cfService_Classification link entity, being used as a vocabulary of educational material, e.g. courses.',NULL,'ORIGINAL','en',58),(59,'This scheme contains CERIF vocabulary terms applicable in link entities relating to medium, such as cfOrgUnit_Medium; cfProj_Medium ... (in the function of e.g. Logo). ',NULL,'ORIGINAL','en',59),(60,'This scheme contains CERIF vocabulary terms applicable in the cfElectronicAddress_Classification link entity, being used as a vocabulary of electronic address types.',NULL,'ORIGINAL','en',60),(61,'The types of Research activity.',NULL,'ORIGINAL','en',61),(62,'The subtypes of an activity used for more specific or finer grained analysis.',NULL,'ORIGINAL','en',62),(63,'The types of funding mechanism.',NULL,'ORIGINAL','en',63),(64,'The status of the publication in the publishing process.',NULL,'ORIGINAL','en',64),(65,'Whether or not the output is known to be peer-reviewed.',NULL,'ORIGINAL','en',65),(66,'If a quality level has been assigned to an output, then this is the assessment of the level of quality on the REF scale (http://www.ref.ac.uk/panels/assessmentcriteriaandleveldefinitions/)',NULL,'ORIGINAL','en',66),(67,'The type of cost allocated to an output in order to make it Open Access or Open Dataset.',NULL,'ORIGINAL','en',67),(68,'The state of verification, deduced from a date-time (e.g. for outputs) where raw data may have been imported from external sources  or for information about staff which might be re-validated on annual basis.',NULL,'ORIGINAL','en',68);
