INSERT INTO `cfclassdef` VALUES (1,'A person (plural: persons or people; from Latin: persona, meaning \"mask\") is a being, such as a human, that has certain capacities or attributes constituting personhood, the precise definition of which is the subject of much controversy.','http://en.wikipedia.org/wiki/Person','ORIGINAL',1,'en',1),(2,'An activity with a specific set of anticpated outputs to be produced over a speficic time-frame.','RMAS Vocabulary','ORIGINAL',1,'en',2),(3,'An organization (or organisation  see spelling differences) is a social group which distributes tasks for a collective goal. The word itself is derived from the Greek word organon, itself derived from the better-known word ergon - as we know `organ` - an','http://en.wikipedia.org/wiki/Organization; RMAS Vocabulary','ORIGINAL',1,'en',3),(4,'A patent ( /ptnt/ or /petnt/) is a form of intellectual property. It consists of a set of exclusive rights granted by a sovereign state to an inventor or their assignee for a limited period of time in exchange for the public disclosure of an inventi','http://en.wikipedia.org/wiki/Patent','ORIGINAL',1,'en',4),(5,'In CERIF, the cfResultProduct (cfResProd) entity is meant conceptually to represent research output, such as an artefact, a device, a performance, an exhibition.','http://www.thefreedictionary.com/product','ORIGINAL',1,'en',5),(6,'Collection of information records that, in combination, represent a full and up-to-date history of research or scholarly published outputs resulting from, or related to, the person\'s research activities.','http://dictionary.casrai.org/research-personnel-profile/1.1.0/contributions/outputs/publications','ORIGINAL',1,'en',6),(7,'Funding is an amount of money or an inkind equivalent value.','CERIF Task Group','ORIGINAL',1,'en',7),(8,'A facility is a space or equipment necessary for conducting research (CERIF Entity). The full economic cost associated with the running of the institutional research facilities and equipment used 