RIGINAL',43,'en',313),(318,'Individual or organization financing a part or all of a project\'s cost as a grant, investment, or loan.','http://www.businessdictionary.com/definition/funder.html','ORIGINAL',46,'en',318),(319,'The initial funding programme document of a funding programme.','CERIF Task Group','ORIGINAL',47,'en',319),(320,'The initial call document of a call.','CERIF Task Group','ORIGINAL',47,'en',320),(321,'The initial tender document of a tender.','CERIF Task Group','ORIGINAL',47,'en',321),(322,'The initial gift document of a gift.','CERIF Task Group','ORIGINAL',47,'en',322),(323,'An issuer is an institution that issues something (securities or publications or currency etc.).','http://wordnetweb.princeton.edu/perl/webwn?s=issuer;','ORIGINAL',48,'en',323),(327,'The definition of a planned activity is being developed.','RMAS Vocabulary','ORIGINAL',50,'en',327),(328,'The definition of a planned activity has been sucessfully reviewed including for example a peer review, ethical review, health and safety review, etc. If not sucessfully reviewed, then the proposal needs adjustment for internal re-review or might change s','RMAS Vocabulary','ORIGINAL',50,'en',328),(329,'The proposed activity has been submitted to the proposed funder for consideration.','RMAS Vocabulary','ORIGINAL',50,'en',329),(330,'The proposed activity has not been and is not expected to be submitted to a funder for consideration.','RMAS Vocabulary','ORIGINAL',50,'en',330),(331,'The state of awarded is to give as judged due or on the basis of merit. The funder has agreed to fund the proposed activity.','RMAS Vocabulary; http://wordnetweb.princeton.edu/perl/webwn?s=Award','ORIGINAL',50,'en',331),(332,'The funder rejected the proposed activity. The state of refused is to refuse to let have.','RMAS Vocabulary; http://wordnetweb.princeton.edu/perl/webwn?s=Award','ORIGINAL',50,'en',332),(333,'The funder has not (yet) responded although the elapsed time since submission implies that the proposal has not been successful.','RMAS Vocabulary','ORIGINAL',50,'en',333),(334,'The funder has agreed to fund the proposed activity but the activity will not proceed (e.g. terms of contract are not acceptable, researchers left institution, etc.).','RMAS Vocabulary','ORIGINAL',50,'en',334),(335,'The activity is considered completed.','RMAS Vocabulary','ORIGINAL',50,'en',335),(341,'An activity that brings together people to discuss topics around an agreed theme.','RMAS Vocabulary','ORIGINAL',52,'en',341),(342,'A book is a collection of leaves of paper, parchment, vellum, cloth, or other material (written, printed, or blank) fastened together along one edge, with or without a protective case or cover.','http://lu.com/odlis/odlis_B.cfm#book','ORIGINAL',52,'en',342),(343,'A book review is an evaluative account of a recent book, usually written and signed by a qualified person, for publication in a current newspaper, magazine, or journal.','http://lu.com/odlis/odlis_R.cfm#review','ORIGINAL',52,'en',343),(344,'A book chapter abstract is a brief, objective representation of the essential content of a book chapter, presenting the main points in the same order as the original but having no independent literary value.','http://lu.com/odlis/index.cfm#abstract','ORIGINAL',52,'en',344),(345,'A book chapter review is an evaluative account of a recent book chapter, usually written and signed by a qualified person, for publication in a current newspaper, magazine, or journal.','http://lu.com/odlis/odlis_R.cfm#review','ORIGINAL',52,'en',345),(346,'An inbook is a part of a book, usually untitled. May be a chapter (or section or whatever) and/or a range of pages.','http://en.wikipedia.org/wiki/BibTeX#Entry_Types','ORIGINAL',52,'en',346),(347,'An anthology is a collection of extracts or complete works by various authors, selected by an editor for publication in a single volume or multivolume set. Anthologies are often limited to a specific literary form or genre (short stories, poetry, plays) o','http://lu.com/odlis/odlis_A.cfm#anthology','ORIGINAL',52,'en',347),(348,'A monograph is a relatively short book or treatise on a single subject, complete in one physical piece, usually written by a specialist in the field. Monographic treatment is detailed and scholarly but not extensive in scope.','http://lu.com/odlis/odlis_M.cfm#monograph','ORIGINAL',52,'en',348),(349,'A referencebook is a book designed to be consulted when authoritative information is needed, rather than read cover to cover. Reference books often consist of a series of signed or unsigned \"entries\" listed alphabetically under headwords or headings, or i','http://lu.com/odlis/odlis_r.cfm#referencebook','ORIGINAL',52,'en',349),(350,'A textbook is an edition of a book specifically intended for the use of students who are enrolled in a course of study or preparing for an examination on a subject or in an academic discipline, as distinct from the trade edition of the same title. Also re','http://lu.com/odlis/odlis_T.cfm#textbook','ORIGINAL',52,'en',350),(351,'An enzyclopedia is a book or numbered set of books containing authoritative summary information about a variety of topics in the form of short essays, usually arranged alphabetically by headword or classified in some manner. An entry may be signed or unsi','http://lu.com/odlis/odlis_E.cfm#encyclopedia','ORIGINAL',52,'en',351),(352,'A manual refers to a book or pamphlet containing practical instructions, rules, or steps for performing a task or operation, assembling a manufactured object, or using a system or piece of equipment. Used synonymously with handbook (ODLIS Dictionary). A m','http://lu.com/odlis/odlis_M.cfm#manual (ODLIS Dicationary); http://purl.org/ntk/gltype#manual (Grey Literature Typology)','ORIGINAL',52,'en',352),(353,'Uncertain of definition','To books not specified other places?','ORIGINAL',52,'en',353),(354,'A journal is a periodical devoted to disseminating original research and commentary on current developments in a specific discipline, subdiscipline, or field of study (example: Journal of Clinical Epidemiology), usually published in quarterly, bimonthly, ','http://lu.com/odlis/odlis_J.cfm#journal','ORIGINAL',52,'en',354),(355,'A journal article is a self-contained nonfiction prose composition on a fairly narrow topic or subject, written by one or more authors and published under a separate title in a collection or periodical containing other works of the same form.','http://lu.com/odlis/odlis_A.cfm#article','ORIGINAL',52,'en',355),(356,'A journal article abstract is a brief, objective representation of the essential content of an article, presenting the main points in the same order as the original but having no independent literary value.','http://lu.com/odlis/index.cfm#abstract','ORIGINAL',52,'en',356),(357,'A journal article review is an evaluative account of a recent of a newly published literary or scholarly work, usually written and signed by a qualified person, for publication in a current newspaper, magazine, or journal.','http://lu.com/odlis/odlis_R.cfm#review','ORIGINAL',52,'en',357),(358,'A conference proceeding is a collection of articles, published abstracs or posters gathered from a conference. Can have several editors.','Pure4 Working group - DK','ORIGINAL',52,'en',358),(359,'A conference proceedings article is an article that has been presented at a conference. Articles has been collected and published in a proceeding.','Pure4 Working group - DK','ORIGINAL',52,'en',359),(360,'A letter (also known as \"communication\") is a brief description of important new research.','Pure4 Working group - DK','ORIGINAL',52,'en',360),(361,'A letter, usually printed at the discretion of the publisher on the editorial page of a newspaper or magazine, in which a reader expresses his or her views on the subject of a previously published article or editorial, or on the editorial policy of the pu','http://lu.com/odlis/odlis_l.cfm#lettereditor','ORIGINAL',52,'en',361),(362,'A PhD Thesis, is a Dissertation/Thesis that leads to the acquirement of a Ph.D. Degree.','Pure4 Working group - DK','ORIGINAL',52,'en',362),(363,'A Doctoral Thesis is a Dissertation/Thesis that leads to the acquirement of a doctoral degree.','Pure4 Working group - DK','ORIGINAL',52,'en',363),(364,'A report is a separately published record of research findings, research still in progress, or other technical findings, usually bearing a report number and sometimes a grant number assigned by the funding agency.','http://lu.com/odlis/odlis_R.cfm#report','ORIGINAL',52,'en',364),(365,'A short communication is a concise, but independent report representing a significant contribution to a subject.','http://www.ejbiotechnology.info/iaformato/short_communications.html','ORIGINAL',52,'en',365),(366,'A poster is a visual presentation of an academic subject presented at a conference.','Pure4 Working group - DK','ORIGINAL',52,'en',366),(367,'Uncertain of definition','Presentation as in a speech? Paper presentation at a conference?','ORIGINAL',52,'en',367),(368,'A newsclipping is an article published in a newspaper, newsmagazine, or online news service, reporting the details of a current event or the latest information on a topic of general interest. News stories are usually short and often unattributed.','http://lu.com/odlis/odlis_N.cfm#newsstory','ORIGINAL',52,'en',368),(369,'A commentary is a written explanation or criticism or illustration that is added to a book or other textual material.','http://wordnetweb.princeton.edu/perl/webwn?s=Commentary','ORIGINAL',52,'en',369),(372,'Translations of books and articles that identify modifications to the original edition, such as a new or revised preface.','http://dictionary.casrai.org/documents/non-academic-funding-cv/1.1/contributions/outputs/publications/translations','ORIGINAL',52,'en',372),(373,'Books written by a single author or collaboratively based on research or scholarly findings generally derived from peer reviewed funding.','http://dictionary.casrai.org/documents/non-academic-funding-cv/1.1/contributions/outputs/publications/books','ORIGINAL',52,'en',373),(374,'Books edited by a single author or collaboratively for the dissemination of research or scholarly findings that generally result from peer reviewed funding.','http://dictionary.casrai.org/documents/non-academic-funding-cv/1.1/contributions/outputs/publications/edited-books','ORIGINAL',52,'en',374),(375,'Texts written by a single author or collaboratively based on research or scholarly findings and expertise in a field.','http://dictionary.casrai.org/documents/non-academic-funding-cv/1.1/contributions/outputs/publications/book-chapters','ORIGINAL',52,'en',375),(376,'A scholarly edition of a text is an edition that is reliable and useful for scholarly purposes. In order to fulfill such purposes, a scholarly edition must live up to high standards.','http://www.iva.dk/bh/core%20concepts%20in%20lis/articles%20a-z/scholarly_edition.htm','ORIGINAL',52,'en',376),(378,'Preliminary versions of articles that have not undergone review but that may be shared for comment.','http://dictionary.casrai.org/documents/non-academic-funding-cv/1.1/contributions/outputs/publications/working-papers','ORIGINAL',52,'en',378),(381,'Collection of information records that, in combination, represent a full and up-to-date history of artistic or performance outputs resulting from, or related to, the person\'s research or scholarly activities. Works may be produced alone or collaboratively','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance','ORIGINAL',52,'en',381),(382,'Showings of works of art under the direction of a curator, an artist or as a graduation exhibition.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/artistic-exhibitions','ORIGINAL',52,'en',382),(388,'Software is a generic term for computer programs and their associated documentation, as opposed to data used as input and generated as output.','http://purl.org/ntk/gltype#software','ORIGINAL',52,'en',388),(389,'Stand-alone locations on the web where multiple types of information on a specific theme are available. May include interactive features for contributions from readers.','http://dictionary.casrai.org/search/Website','ORIGINAL',52,'en',389),(391,'A series of structured observations, measurements or facts identified from the research which can be stored in a database medium.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/other-outputs/data-sets','ORIGINAL',52,'en',391),(393,'Periodical publications aimed at fostering intellectual debate and inquiry. Special journal issues are produced by editors with an established record of scholarship in the field and able to provide the direction of the theme. Journal issues bear a unique ','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/publications/journal-issues','ORIGINAL',52,'en',393),(394,'Articles on research findings published jointly with or supervised by the thesis advisor. The findings relate to research undertaken by the student or the supervisors program of research.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/publications/supervised-student-publications','ORIGINAL',52,'en',394),(395,'Authored entries in a reference work or a compendium focusing on a particular domain or on all branches of knowledge.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/publications/encyclopedia-entries','ORIGINAL',52,'en',395),(396,'Articles in thematic publications published at fixed intervals.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/publications/magazine-articles','ORIGINAL',52,'en',396),(397,'Entries of new words, new meanings of existing words, changes in spelling and hyphenation over a longer period of time, and grammatical changes.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/publications/dictionary-entries','ORIGINAL',52,'en',397),(398,'Series of observations, measurements or facts identified from the research. They include bibliographies, indices and catalogues of research collections; concordances and dictionaries; materials that facilitate access to archival holdings or collections su','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/publications/research-tools','ORIGINAL',52,'en',398),(399,'Information accessible only on the web via traditional technical methods (ie hyperlinks).','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/publications/online-resources','ORIGINAL',52,'en',399),(400,'Assessments that include tests designed for general university selection, selection into specific courses or other evaluation purposes.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/publications/tests','ORIGINAL',52,'en',400),(401,'Texts of a specified length that states the issue to be discussed in a proposed conference paper. It serves as the basis for the acceptance of the paper at a conference. The abstract is published along with the paper.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/conferences/conference-abstracts','ORIGINAL',52,'en',401),(402,'Posters displayed in a conference setting and conveying research highlights in an efficient manner by compelling graphics. They may be peer-reviewed prior to acceptance and be published in the proceedings.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/conferences/conference-posters','ORIGINAL',52,'en',402),(403,'Original musical scores available in a format for dissemination.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/musical-compositions','ORIGINAL',52,'en',403),(404,'Original musical scores available in a format for dissemination.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/musical-performances','ORIGINAL',52,'en',404),(405,'Programming produced for and broadcast on radio or TV.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/radiotv-programs','ORIGINAL',52,'en',405),(406,'Written versions of a play, film, broadcast or other dramatic composition used in preparing for a performance and annotated with instructions for the performance.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/scripts','ORIGINAL',52,'en',406),(407,'Original literary texts (prose or poetry).','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/short-fiction','ORIGINAL',52,'en',407),(408,'Creation, production, dissemination of plays by professional theatre artists and organizations. The artifacts, such costumes, props, sets and scripts, may be the object of a public exhibit.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/theatric','ORIGINAL',52,'en',408),(409,'Works such as film, video, or new media developed as a result of an artistic practice. May serve for commercial purposes.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/video-recordings','ORIGINAL',52,'en',409),(410,'Works such as film, video, or new media developed as a result of an artistic practice. May serve for commercial purposes.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/visual-artworks','ORIGINAL',52,'en',410),(411,'Art and process of manipulating audio elements to achieve a desired effect. It is employed in a variety of disciplines including film, theatre, music recording, and live music performance. It involves the manipulation of previously composed audio or the c','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/sound-design','ORIGINAL',52,'en',411),(412,'Creations of theatrical, as well as film or television scenery (also known as stage design, scenic design or production design).','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/set-design','ORIGINAL',52,'en',412),(413,'Works done within theatre or in relation to an art installation to design a production.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/light-design','ORIGINAL',52,'en',413),(414,'Dance compositions created for production and dissemination.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/artisticperformance/choreography','ORIGINAL',52,'en',414),(415,'Collection of information records that, in combination, represent a full and up-to-date history of the intellectual property owned by the person and resulting from, or related to, the person\'s research activities.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/conferences','ORIGINAL',52,'en',415),(416,'Collection of information records that, in combination, represent a full and up-to-date history of the intellectual property owned by the person and resulting from, or related to, the person\'s research activities.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/intellectual-property','ORIGINAL',52,'en',416),(417,'Signed agreements to exploit a piece of IP such as a process, product, data, or software.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/intellectual-property/licenses','ORIGINAL',52,'en',417),(418,'Publications that establish inventions as prior art thereby preventing others from patenting the same invention or concept.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/intellectual-property/disclosures','ORIGINAL',52,'en',418),(419,'Registered ownership of rights under a system of laws for promoting both the creation of and access to artistic, literary, musical, dramatic and other creative works.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/intellectual-property/registered-copyrights','ORIGINAL',52,'en',419),(420,'Marks such as a name, word, phrase, logo, symbol, design, image of a product or service that indicates the source and provides the right to control the use of the identifier.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/intellectual-property/trademarks','ORIGINAL',52,'en',420),(421,'The development of a rule or principle that is used as a basis for judgement.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/other-outputs/standards-and-policies','ORIGINAL',52,'en',421),(422,'Technical Standards (industrial or otherwise) that have originated from the research projects in which new protocols, methods or materials may be developed.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/other-outputs/technical-standards','ORIGINAL',52,'en',422),(423,'A practical methods or skills applied to particular tasks identified as part of the research.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/other-outputs/research-techniques','ORIGINAL',52,'en',423),(424,'Practical and original outputs arising from research.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/other-outputs/inventions','ORIGINAL',52,'en',424),(425,'The act or process of contesting at law.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/other-outputs/litigation','ORIGINAL',52,'en',425),(426,'An academic institution is an educational institution dedicated to education and research, which grants academic degrees.','http://en.wikipedia.org/wiki/Academic_institution','ORIGINAL',53,'en',426),(427,'A university is an institution of higher education and research, which grants academic degrees in a variety of subjects. A university is a corporation that provides both undergraduate education and postgraduate education.','http://en.wikipedia.org/wiki/University','ORIGINAL',53,'en',427),(428,'The term \"university college\" is used in a number of countries to denote college institutions that provide tertiary education but do not have full or independent university status. A university college is often part of a larger university. The precise usa','http://en.wikipedia.org/wiki/University_college','ORIGINAL',53,'en',428),(429,'A research institute is an establishment endowed for doing research. Research institutes may specialize in basic research or may be oriented to applied research.','http://en.wikipedia.org/wiki/Research_institute','ORIGINAL',53,'en',429),(430,'A strategic research institute\'s core mission is to provide analyses that respond to the needs of decision-makers.','CERIF Task Group','ORIGINAL',53,'en',430),(431,'A company is a form of business organization. In the United States, a company is a corporationor, less commonly, an association, partnership, or unionthat carries on an industrial enterprise.\" Generally, a company may be a \"corporation, partnership, ass','http://en.wikipedia.org/wiki/Company','ORIGINAL',53,'en',431),(432,'Small and medium enterprises (also SMEs, small and medium businesses, SMBs, and variations thereof) are companies whose headcount or turnover falls below certain limits. EU Member States traditionally have their own definition of what constitutes an SME, ','http://en.wikipedia.org/wiki/Small_and_medium_enterprises; http://ec.europa.eu/enterprise/policies/sme/facts-figures-analysis/sme-definition/index_en.htm','ORIGINAL',53,'en',432),(433,'A government is the organization, or agency through which a political unit exercises its authority, controls and administers public policy, and directs and controls the actions of its members or subjects.','http://en.wikipedia.org/wiki/Government','ORIGINAL',53,'en',433),(434,'Higher education or post-secondary education refers to a level of education that is provided at academies, universities, colleges, seminaries, institutes of technology, and certain other collegiate- level institutions, such as vocational schools, trade sc','http://en.wikipedia.org/wiki/Higher_education','ORIGINAL',53,'en',434),(435,'An organization that is incorporated under state law and whose purpose is not to make profit, but rather to further a charitable, civic, scientific, or other lawful purpose.','CERIF Task Group','ORIGINAL',53,'en',435),(436,'An intergovernmental organization, sometimes rendered as an international governmental organization and both abbreviated as IGO, is an organization composed primarily of sovereign states (referred to as member states), or of other intergovernmental organi','http://en.wikipedia.org/wiki/Intergovernmental_organization','ORIGINAL',53,'en',436),(437,'A charitable organization is a type of non-profit organization (NPO). It differs from other types of NPOs in that it centers on philanthropic goals (e.g. charitable, educational, religious, or other activities serving the public interest or common good). ','http://en.wikipedia.org/wiki/Charitable_organization','ORIGINAL',53,'en',437),(438,'Hospitals, trusts and other bodies receiving funding from central governement through the national insurance scheme.','RMAS Vocabulary','ORIGINAL',53,'en',438),(439,'Grants and contracts income from all government bodies operating in the EU, which includes the European Commission but excludes bodies in the UK.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',439),(440,'EU-based non-competitive charities and any other EU income that cannot otherwise be allocated more specifically.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',440),(441,'Income services that cannot otherwise be allocated more specifically.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',441),(442,'Grants and contracts income from industrial and commercial companies and public corporations (defined as publicly owned trading bodies, usually statutory corporations, with a substantial degree of financial independence) operating in the UK.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',442),(443,'The sources of income from BBSRC, MRC, NERC, EPSRC, ESRC, AHRC, STFC, The Royal Society, British Academy, The Royal Society of Edinburgh','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',443),(444,'Grants and contracts income from all charitable foundations, charitable trusts etc., based in the UK which are registered with the Charities Commission exempt Research Counculs, central government bodies/local authorities, health & hospital authorities. T','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',444),(445,'Grants and contracts income from UK central government bodies, UK local authorities and UK health and hospital authorities, except Research Councils and UK public corporations. This should include government departments, and other organisations (including','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',445),(446,'Grants and contracts income from an EU body with exclusively charitable purposes consistent with the definition set out in the Charities Act 2006 and which exists for the public benefit in a manner which is consistent with the Public Benefit Guidance publ','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',446),(447,'Grants and contracts income from industrial and commercial companies and public corporations (defined as publicly owned trading bodies, usually statutory corporations, with a substantial degree of financial independence) operating from outside the EU.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',447),(448,'Grants and contracts income from industrial companies operating in the EU outside of the UK. Such income received from a multinational company should be coded depending on the location of the office making the award, e.g. a multinational with a French sub','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',448),(449,'Grants and contracts income from commercial companies and public corporations (defined as publicly owned trading bodies, usually statutory corporations, with a substantial degree of financial independence) operating in the EU outside of the UK. Such incom','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',449),(450,'Grants and contracts income from industrial and commercial companies and public corporations (defined as publicly owned trading bodies, usually statutory corporations, with a substantial degree of financial independence) operating outside of the EU. Such ','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',450),(451,'Grants and contracts income from commercial companies and public corporations (defined as publicly owned trading bodies, usually statutory corporations, with a substantial degree of financial independence) operating outside of the EU. Such income received','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',451),(452,'Grants and contracts income from a Non-EU body with exclusively charitable purposes consistent with the definition set out in the Charities Act 2006 and which exists for the public benefit in a manner which is consistent with the Public Benefit Guidance p','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',452),(453,'Grants and contracts income not to be allocated more specifically. This should include income from other higher education institutions (HEIs).','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',453),(454,'Grants received as a Donation.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',454),(455,'Grants allocated by the institution.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',455),(456,'Income from Knowledge Transfer Partnerships (KTPs) apart from any portion in respect of studentships or tuition fees.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',456),(457,'Non-EU-based non-competitive charities and any other Non-EU income that cannot otherwise be allocated more specifically.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',457),(458,'Grants and contracts income from all government bodies operating in the UK.','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',458),(459,'Grants and contracts income not covered by other types. This should include income from other higher education institutions (HEIs).','http://www.hesa.ac.uk/index.php?option=com_content&task=view&id=1317&Itemid=233','ORIGINAL',54,'en',459),(460,'An activity that brings together people to discuss topics around an agreed theme.','RMAS Vocabulary','ORIGINAL',55,'en',460),(461,'A physical or virtual networking activity bringing people together for a single gathering.','RMAS Vocabulary','ORIGINAL',55,'en',461),(467,'ORCID is an international, interdisciplinary, open, and not-for-profit organization created for the benefit of all stakeholders, including research institutions, funding organizations, publishers, and researchers to enhance the scientific discovery proces','http://about.orcid.org/','ORIGINAL',56,'en',467),(468,'The institution identifier of the reporting institution. The institution is identified by two fields, field 2, HESA institution identifier (a four digit number relating to the institution) and field 3, Campus identifier, a single alphanumeric character. T','http://www.hesa.ac.uk/index.php?option=com_collns&task=show_manuals&Itemid=233&r=96011&f=2','ORIGINAL',56,'en',468),(469,'The Staff identifier is a unique code allocated to a staff member when they are first entered onto the staff record and, where a member of staff is contracted to work in jobs classified in SOC groups 1,2 or 3, it stays with them for the whole of their car','http://www.hesa.ac.uk/component/option,com_collns/task,show_manuals/Itemid,233/r,08025/f,003/','ORIGINAL',56,'en',469),(470,'The Student identifier is to be unique to each student. It is intended that the identifier is to be transferred with the student to each institution of higher education he/she may attend. The medium term objective is that the use of this number will allow','http://www.hesa.ac.uk/index.php?option=com_collns&Itemid=233&task=show_manuals&r=96011&f=004','ORIGINAL',56,'en',470),(471,'The ResearcherID by Thomson Reuters.','http://www.researcherid.com/','ORIGINAL',56,'en',471),(472,'The UK Register of Learning Providers is a \'one-stop\' portal to be used by government departments, agencies, learners, and employers to share key information about learning providers. The UKRLP allows providers to update their information in one place and','http://www.ukrlp.co.uk/','ORIGINAL',56,'en',472),(481,'The International Standard Name Identifier (ISNI) is an ISO Standard (ISO 27729) whose scope is the identification of Public Identities of parties: that is, the identities used publicly by parties involved throughout the media content industries in the cr','http://www.isni.org/','ORIGINAL',56,'en',481),(484,'A value added tax identification number or VAT identification number (VATIN) is an identifier used in many countries, including the countries of the European Union, for value added tax purposes.','http://en.wikipedia.org/wiki/VAT_identification_number','ORIGINAL',56,'en',484),(485,'A Funding Programme is the source of financial means to a project, programme, equipment, event or any other structured scientific activity. A Funding Programme is managed by a Funding Organisation.','http://www.eurocris.org/Uploads/Web%20pages/members_meetings/200905_-_Athens__Greece/Funding_Program_Workshop._Introduction_-_Geert_van_Grootel.ppt','ORIGINAL',57,'en',485),(486,'no source found','CERIF Task Group','ORIGINAL',57,'en',486),(487,'A call for tenders from a funder addressing a specific requirement resulting in a number of contracts.','CERIF Task Group','ORIGINAL',57,'en',487),(488,'A gift or a present is the transfer of something without the expectation of receiving something in return. Although gift-giving might involve an expectation of reciprocity, a gift is meant to be free.','http://en.wikipedia.org/wiki/Gift','ORIGINAL',57,'en',488),(489,'Where the source of funding comes from the institution itself (e.g. a university-wide conference-attendance scheme).','RMAS Vocabulary','ORIGINAL',57,'en',489),(490,'A course text is a type of study text used as a support for students.',NULL,'ORIGINAL',58,'en',490),(492,'The logo representing an entity, such as organisation, product, project.','CERIF Task Group','ORIGINAL',59,'en',492),(497,'An activity with a specific set of anticpated outputs to be produced over a speficic time-frame.','RMAS Vocabulary','ORIGINAL',61,'en',497),(498,'An activity that brings together people to discuss topics around an agreed theme.','RMAS Vocabulary','ORIGINAL',61,'en',498),(499,'An award for an individual allowing to undertake generic or specific research.','RMAS Vocabulary','ORIGINAL',61,'en',499),(500,'An activity which brings together either physically or virtually groups of people, normally over a period of time to meet and exchange information and good practice.','RMAS Vocabulary','ORIGINAL',61,'en',500),(501,'An activity to develop or maintain equipment, facilities, services or buildings.','RMAS Vocabulary','ORIGINAL',61,'en',501),(502,'(The work undertaken by a person during) a funded research degree.','RMAS Vocabulary','ORIGINAL',61,'en',502),(503,'An organization (or organisation  see spelling differences) is a social group which distributes tasks for a collective goal. The word itself is derived from the Greek word organon, itself derived from the better-known word ergon - as we know `organ` - an','http://en.wikipedia.org/wiki/Organization; RMAS Vocabulary','ORIGINAL',62,'en',503),(504,'A facility is a space or equipment necessary for conducting research (CERIF Entity). The full economic cost associated with the running of the institutional research facilities and equipment used in an activity (Activity Finance Category). The specificati','CERIF Task Group; http://www.jcpsg.ac.uk/guidance/','ORIGINAL',62,'en',504),(505,'An activity which brings together either physically or virtually groups of people, normally over a period of time to meet and exchange information and good practice.','RMAS Vocabulary','ORIGINAL',62,'en',505),(506,'A project with a specific set of anticipated research outputs to be produced over a specific time-frame.','RMAS Vocabulary','ORIGINAL',62,'en',506),(507,'A project funded for an expected outcome (normally specified by the funder).','RMAS Vocabulary','ORIGINAL',62,'en',507),(508,'A project undertaken by an early career researcher, for example someone in the first four years of their academic post.','RMAS Vocabulary','ORIGINAL',62,'en',508),(509,'A specific bounded (time and specification) contribution to an activity.','RMAS Vocabulary','ORIGINAL',62,'en',509),(510,'An activity to (or to support) the transfer of resarch outputs or outcomes into the private sector.','RMAS Vocabulary','ORIGINAL',62,'en',510),(511,'The support for the career development of Researchers, Research Students or Research Leaders.','RMAS Vocabulary','ORIGINAL',62,'en',511),(512,'The activity to support working with the private sector.','RMAS Vocabulary','ORIGINAL',62,'en',512),(513,'The specific activity type defined by the technology strategy board of the UK government.','RMAS Vocabulary','ORIGINAL',62,'en',513),(514,'A large-scale activity designed to comprise a number of projects.','RMAS Vocabulary','ORIGINAL',62,'en',514),(515,'Attending an event (e.g conference).','RMAS Vocabulary','ORIGINAL',62,'en',515),(516,'Hosting an event (e.g conference).','RMAS Vocabulary','ORIGINAL',62,'en',516),(517,'A fellowship awarded to an individual.','RMAS Vocabulary','ORIGINAL',62,'en',517),(518,'A fellowship awarded to an institution for which an individual can subsequently apply to.','RMAS Vocabulary','ORIGINAL',62,'en',518),(519,'The costs associated with travel and subsistence (Activity Finance Category). A physical networking activity normally associated with a single or short series of visits (Activity Subtypes).','RMAS Vocabulary','ORIGINAL',62,'en',519),(520,'A physical or virtual networking activity bringing people together for a single gathering.','RMAS Vocabulary','ORIGINAL',62,'en',520),(521,'The specification, procurement and installation of buildings.','RMAS Vocabulary','ORIGINAL',62,'en',521),(522,'(The work undertaken by a person during) a funded research degree which involves an external agency as part of or host to the research work (e.g. a research council collaborative doctoral award).','RMAS Vocabulary','ORIGINAL',62,'en',522),(523,'(The work undertaken by a person during) a funded research degree.','RMAS Vocabulary','ORIGINAL',62,'en',523),(524,'(The work undertaken by a number of people during) a block of funded research degrees (e.g. a research council block-grant partnership).','RMAS Vocabulary','ORIGINAL',62,'en',524),(525,'The funding mechanism where discretionary funds are awarded based on an achievement (Activity Finance Category).','RMAS Vocabulary','ORIGINAL',63,'en',525),(526,'The funding mechanism where a proposed activity is submitted for consideration and where the funding is approved (Activity Finance Category).','RMAS Vocabulary','ORIGINAL',63,'en',526),(527,'The funding mechanism where a proposed activity is submitted for consideration and where the funding is approved and will be allocated on successful delivery of the proposed outputs (Activity Finance Category).','RMAS Vocabulary','ORIGINAL',63,'en',527),(528,'A (planned) output.','RMAS Vocabulary','ORIGINAL',64,'en',528),(529,'A final draft submitted for consideration.','RMAS Vocabulary','ORIGINAL',64,'en',529),(530,'An accepted but not yet published output.','RMAS Vocabulary','ORIGINAL',64,'en',530),(531,'An output available in the public domain (paid or open access or grey literature, and including but not restricted to \"public domain works\").','RMAS Vocabulary','ORIGINAL',64,'en',531),(532,'A proposed output never put in the public domain.','RMAS Vocabulary','ORIGINAL',64,'en',532),(533,'Where the output has been subject to assessment and critique by independent experts.','RMAS Vocabulary','ORIGINAL',65,'en',533),(534,'Where the output has not been subject to assessment and critique by independent experts.','RMAS Vocabulary','ORIGINAL',65,'en',534),(535,'Where it is unknown whether the output has been subject to assessment and critique by independent experts.','RMAS Vocabulary','ORIGINAL',65,'en',535),(536,'An assessment has yet to be made of the quality level of the output.','http://www.ref.ac.uk/panels/assessmentcriteriaandleveldefinitions/','ORIGINAL',66,'en',536),(537,'Quality that is world-leading in terms of originality, significance and rigour.','http://www.ref.ac.uk/panels/assessmentcriteriaandleveldefinitions/','ORIGINAL',66,'en',537),(538,'Quality that is internationally excellent in terms of originality, significance and rigour but which falls short of the highest standards of excellence.','http://www.ref.ac.uk/panels/assessmentcriteriaandleveldefinitions/','ORIGINAL',66,'en',538),(539,'Quality that is recognised internationally in terms of originality, significance and rigour.','http://www.ref.ac.uk/panels/assessmentcriteriaandleveldefinitions/','ORIGINAL',66,'en',539),(540,'Quality that is recognised nationally in terms of originality, significance and rigour.','http://www.ref.ac.uk/panels/assessmentcriteriaandleveldefinitions/','ORIGINAL',66,'en',540),(541,'Quality that falls below the standard of nationally recognised work. Or work which does not meet the published definition of research for the purposes of this assessment.','http://www.ref.ac.uk/panels/assessmentcriteriaandleveldefinitions/','ORIGINAL',66,'en',541),(542,'The cost charged by a publisher to make an individual output freely available.','RMAS Vocabulary','ORIGINAL',67,'en',542),(543,'The cost of depositing a version of the publication for free public access in a CRIS/institutional repository. Normally this cost will be zero.','RMAS Vocabulary','ORIGINAL',67,'en',543),(544,'The cost of depositing a version of the research data for free public access in a CRIS/institutional repository. The cost may not be zero.','RMAS Vocabulary','ORIGINAL',67,'en',544),(545,'checked','RMAS Vocabulary','ORIGINAL',68,'en',545),(546,'not yet checked','RMAS Vocabulary','ORIGINAL',68,'en',546);
INSERT INTO `cfclassdescr` VALUES (1,'In CERIF, the concept of person is physically (cfPers) and logically (cfPerson) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. persons (cfPers_Pers), qualifications (cfPers_Qual), events (cfPers_Event), classification systems (cfPers_Class), countries (cfPers_Country).In the CERIF vocabulary, we introduce the concept of person. In the physical CERIF data model, the classification of types for persons happens with the cfPers_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning person types to person records.','CERIF Task Group','ORIGINAL',1,'en',1),(2,'In CERIF, the concept of project is physically (cfProj) and logically (cfProject) defined as an entity in an ERM, represented by basic attributes and through maintaining relationships with other entities: projects (cfProj_Proj), classification systems (cfProj_Class), persons (cfProj_Pers), indicators (cfProj_Indic), measurements (cfProj_Meas). In the CERIF vocabulary, we introduce the concept of project. In the physical CERIF data model, the classification of types for projects happens with the cfProj_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning project types to project records.','CERIF Task Group','ORIGINAL',1,'en',2),(3,'In CERIF, the concept of organisation is physically (cfOrgUnit) and logically (cfOrganisationUnit) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. person (cfPers_OrgUnit), events (cfOrgUnit_Event), classification systems (cfOrgUnit_Class), projects (cfProj_OrgUnit). In the CERIF vocabulary, we introduce the concept of organisation. In the physical CERIF data model, the classification of types for organisations happens with the cfOrgUnit_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning organisation types to organisation records.','CERIF Task Group','ORIGINAL',1,'en',3),(4,'In CERIF, the concept of patent is physically (cfResPat) and logically (cfResultPatent) defined as an entity in an ERM, described through basic attributes and through In the CERIF vocabulary, we introduce the concept of patent. In the physical CERIF data model, the classification of types for patents happens with the cfResPat_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning patent types to patent records.','CERIF Task Group','ORIGINAL',1,'en',4),(5,'In CERIF, the concept of product is physically (cfResProd) and logically (cfResultProduct) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. persons (cfPers_ResProd), organisations (cfOrgUnit_ResProd), classification systems (cfResProd_Class), projects (cfProj_ResProd). \"The entity product in CERIF has often caused confusion, it was maybe not stressed enough, that a cerif product is considered a result in general, achieved through some effort - and not at all is it a commercial or a physical product only. It was intended also to represent i.e. software or \'research data\'. The Australian National Data Services aims at collecting definitions for clarifiying the concept of \"\"research data\"\". In CERIF, cfResProd (cfResultProduct) is an entity in the ERM. In the CERIF vocabulary, we introduce the concept of product. In the physical CERIF data model, the classification of types for products happens with the cfProduct_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning product types to product records.\"','CERIF Task Group','ORIGINAL',1,'en',5),(6,'In CERIF, the concept of publication is physically (cfResPubl) and logically (cfResultPublication) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. persons (cfPers_ResPubl), organisations (cfOrgUnit_ResPubl), classification systems (cfResPubl_Class), projects (cfProj_ResPubl). \"In CERIF, cfResPubl (cfResultPublication) is an entity in the ERM. In the CERIF vocabulary, we introduce the concept of publication. Behind the publication concept in research there are moslty peer-reviewed publications (journal articles, conference articles). More and more, there are also other publication types of interest in the scientific domain, so-called \'Grey Literature\', and multiple schemes are available to collect publication types. In the physical CERIF data model, the classification of types for publications happens with the cfResPubl_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning publication types to publication records.','CERIF Task Group','ORIGINAL',1,'en',6),(7,'In CERIF, the concept of funding is physically (cfFund) and logically (cfFunding) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. persons (cfPers_Fund), organisations (cfOrgUnit_Fund), classification systems (cfRund_Class), projects (cfProj_Fund). In the CERIF vocabulary, we introduce the concept of funding. In the physical CERIF data model, the classification of types for funding happens with the cfFund_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning funding types to funding records.','CERIF Task Group','ORIGINAL',1,'en',7),(8,'In CERIF, the concept of Facility (also Research Facility) is physically (cfFacil) and logically (cfFacility) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. persons (cfPers_Facil), organisations (cfOrgUnit_Facil), classification systems (cfFacil_Class), projects (cfProj_Facil). In the physical CERIF data model, the classification of types for facility happens with the cfFacil_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning facility types to facility records.\"','CERIF Task Group','ORIGINAL',1,'en',8),(9,'In CERIF, the concept of equipment is physically (cfEquip) and logically (cfEquipment) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. persons (cfPers_Equip), organisations (cfOrgUnit_Equip), classification systems (cfEquip_Class), projects (cfProj_Equip). In the physicial CERIF data model, the classification of types for equipment happens with the cfEquip_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning equipment types to equipment records.\"','CERIF Task Group','ORIGINAL',1,'en',9),(10,'In CERIF, the concept of serive is physically (cfSrv) and logically (cfService) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. persons (cfPers_Srv), organisations (cfOrgUnit_Srv), classification systems (cfSrv_Class), projects (cfProj_Srv). In the CERIF vocabulary, we introduce the concept of service. In the physical CERIF data model, the classification of types for service happens with the cfSrv_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning service types to service records.\"','CERIF Task Group','ORIGINAL',1,'en',10),(11,'In CERIF, the citation entity is used for publication references (citations) to outside of the current information system. Otherwise, citation counts may be deduced from physical publication-publication relationships, i.e. cfResPubl_ResPubl (physical) or cfResultPublication_cfResultPublication (logical) and stored as a measurement cfResPubl_Meas (cfResultPublication_Measurement).','CERIF Task Group','ORIGINAL',1,'en',11),(12,'In CERIF, the CV entity is used for curriculum vitae information references.','CERIF Task Group','ORIGINAL',1,'en',12),(13,'In CERIF, the concept of electronic address is physically (cfEAddr) and logically (cfElectronicAddress) defined as an entity in the ERM, described through basic attributes and through semantically neutral relationships with persons (cfPers_EAddr), organisations (cfOrgUnit_EAddr), classification systems (cfEAddr_Class).','CERIF Task Group','ORIGINAL',1,'en',13),(14,'In CERIF, the concept of physical address is physically (cfPAddr) and logically (cfPhysicalAddress) defined as an entity in the ERM, described through basic attributes and through semantically neutral relationships with persons (cfPers_PAddr), organisations (cfOrgUnit_PAddr), classification systems (cfPAddr_Class).','CERIF Task Group','ORIGINAL',1,'en',14),(15,'In CERIF, the concept of event is physically and logically defined as an entity cfEvent in the ERM, described through basic attributes and through semantically neutral relationships e.g. with persons (cfPers_Event), organisations (cfOrgUnit_Event), classification systems (cfEvent_Class).','CERIF Task Group','ORIGINAL',1,'en',15),(16,'In CERIF, the concept of medium is physically and logically defined as an entity cfMedium in the ERM, described through basic attributes and through semantically neutral relationships e.g. with persons (cfPers_Event), organisations (cfOrgUnit_Event), classification systems (cfEvent_Class).','CERIF Task Group','ORIGINAL',1,'en',16),(17,'In CERIF, the concept of qualification is physically (cfPAddr) and logically (cfPhysicalAddress) defined as an entity in the ERM, described through basic attributes and through semantically neutral relationships with persons (cfPers_Qual) and classification systems (cfQual_Class).','CERIF Task Group','ORIGINAL',1,'en',17),(18,'In CERIF, the cfFederatedIdentifier entity is an hybrid entity in the sense that it connects the internal world with an outside world, of which we do not know what can be assumed to be known. For consistency, this entity has ist own cfFederatedIdentifier identifier - namely in short cfFedIdId as an ID and primary key (PK). Finally, the entity has the cfInstanceIdentifier as a character, identifying the record for which this federate identifier is required - in short cfFedInstId. These two just introduced identifiers, in sort cfFedIdId, and cfFedIdInstId represent the internal world of the system. However, following the CERIF link entity style, the linked entity identifier is also required; pointing to the outside world, namely this is the cfFedId or cfFederatedIdentifier as such. It can possibly have a role that is applicable with Relation. We assume that currrently the only role appied is \"same as\", where for future applications it may be useful to have the usual cfClassId/cfClassSchemeId reference optionally available (e.g. for possible constraints such as - the fed-id-link is valid only for a person in the role of an author). However, especially with the CERIF XML, we currently recommend to omit it, because the cfFedId entity is embeded in the base entity and thus, the same-as attribute is implictly known from the structure of the XML record (see examples and specification documents).','CERIF Task Group','ORIGINAL',1,'en',18),(19,'In CERIF, the cfMeasurement entity has been introduced in the context of Impact, which in CERIF is an indicator cfIndicator. In CERIF, a measurement can thus be linked to an indicator through the link entity cfIndicator_Measurement (CERIF link entities are neutral in reading directions), incorporating the usual link entity construct, i.e. Semantic Layer references.','CERIF Task Group','ORIGINAL',1,'en',19),(20,'In CERIF, the cfIndicator entity has been introduced in the context of Impact. In CERIF, an indicator can be linked to a measurement through the link entity cfIndicator_Measurement (CERIF link entities are neutral in reading directions), incorporating the usual link entity construct, i.e. Semantic Layer references.','CERIF Task Group','ORIGINAL',1,'en',20),(31,'In CERIF terms, professor is a role in e.g. the person-organisation relationship; that is, the classification term (cfTerm) \"Professor\" identified by its cfClassificationIdentifier (a uuid) and reused in link entities.','CERIF Task Group','ORIGINAL',3,'en',31),(34,'In CERIF terms, associate is a role in e.g. the person-organisation relationship; that is, the classification term (cfTerm) \"Associate\" identified by its cfClassificationIdentifier (a uuid) and reused in the e.g. cfPerson_OrganisationUnit entity.','CERIF Task Group','ORIGINAL',3,'en',34),(41,'In CERIF terms, co-investigator is a role in e.g. the person-project relationship; that is, the classification term (cfTerm) \"Co-Investigator\" identified by its cfClassificationIdentifier (a uuid) and reused in link entities.','CERIF Task Group','ORIGINAL',5,'en',41),(49,'In CERIF terms, the member role happens e.g. within the relationships person-organisation, person-project; organisation-organisation, that is, the classification term (cfTerm) \"Member\" identified by its cfClassificationIdentifier (a uuid), and reused with e.g. the cfPerson_OrganisationUnit; cfProject_Person; cfOrganisationUnit_OrganisationUnit relationships. A person can be a member of multiple organisat