ject_Person link entities.','CERIF Task Group','ORIGINAL',34,'en',245),(246,'In CERIF terms, administrator is a role in e.g. the person-organisation relationship; that is, the classification term (cfTerm) \"Administrator\" identified by its cfClassificationIdentifier (a uuid) and reused in link entities (CERIF Task Group). An administrator directly employed by an organisation (RMAS Project).','CERIF Task Group','ORIGINAL',34,'en',246),(247,'In CERIF terms, technician is a role in e.g. the person-organisation relationship; that is, the classification term (cfTerm) \"Technician\" identified by its cfClassificationIdentifier (a uuid) and reused inlink entities. (CERIF Task Group) A permanent Research staff. (RMAS project)','CERIF Task Group','ORIGINAL',34,'en',247),(248,'In CERIF terms, researcher is a role in e.g. the person-organisation relationship; that is, the classification term (cfTerm) \"Researcher\" identified by its cfClassificationIdentifier (a uuid) and reused in link entities.','CERIF Task Group','ORIGINAL',34,'en',248),(249,'In CERIF terms, consultant is a role in e.g. the person-organisation relationship; that is, the classification term (cfTerm) \"Consultant\" identified by its cfClassificationIdentifier (a uuid) and reused in link entities.','CERIF Task Group','ORIGINAL',34,'en',249),(250,'In CERIF terms, phd is a role in e.g. the person-organisation relationship; that is, the classification term (cfTerm) \"PhD\" identified by its cfClassificationIdentifier (a uuid) and reused in link entities.','CERIF Task Group','ORIGINAL',34,'en',250),(252,'In CERIF terms, principal investigator is a role in e.g. the person-project relationship; that is, the classification term (cfTerm) \"Principal Investigator\" identified by its cfClassificationIdentifier (a uuid) and reused in link entities.','CERIF Task Group','ORIGINAL',34,'en',252),(253,'In CERIF terms, co-investigator is a role in e.g. the person-project relationship; that is, the classification term (cfTerm)