 person-organisation or person-project; that is, the classification term (cfTerm) \"Manager\" identified by its cfClassificationIdentifier (a uuid), and reused with the e.g. cfPerson_OrganisationUnit or cfProject_Person relationships.','CERIF Task Group','ORIGINAL',36,'en',292),(293,'The person to be contacted in a particular circumstance (e.g. finance).','RMAS Vocabulary','ORIGINAL',36,'en',293),(307,'In CERIF, the concept of research output is defined as a term in the vocabulary. Research output in CERIF terms subsumes results such as publications cfResultPublication (cfResPubl), patent cfResultPatent (cfResPat) and product cfResultProduct (cfResProd); these are logic and physic enitites in the CERIF data model.','CERIF Task Group','ORIGINAL',38,'en',307),(310,'In CERIF, the concept of research infrastructure is defined as a term in the vocabulary. A research infrastructure in CERIF terms subsumes the three entities service cfService (cfSrv), equipment cfEquipment (cfEquip) and facility cfFacility (cfFacil); these are logic and physic enitites in the CERIF data model.','CERIF Task Group','ORIGINAL',41,'en',310),(336,'A distributed RI is constituted by geographically distributed implementations/facilities but managed by a single body. Thus,adistributed RIisthus considered asasingleRI, modelled in CERIF as a tree of facilities connected to the Facility entity representing the entire RI via recursive cfFacility_Facility relationships withappropriatesemantics (e.g. isPartOf)while the RI is connected with its managing body through the cfOrgUnit_Facillinkentity.',NULL,'ORIGINAL',51,'en',336),(337,'A network ofRIscomprisesseveral RIs connectedin some respect, buteachonewithitsowngovernance/management body. The relationships between RIs in a network are modelled in CERIF using the CERIF Semantic Layer reference from within the cfFacil_Class linkentity (Class=Network, role expression is a network).',NULL,'ORIGINAL',51,'en',337),(338,'A virtualRIisdefinedase-infrastructure,eitheradistributedeinfrastructurethatconnects severalRIs (databases,HP computers,facilities,etc)orasinglesitedelectronicRI (e-library, e-archive, data repository, etc). ',NULL,'ORIGINAL',51,'en',338),(339,'A cluster is a grouping of RIs based on certain similarities (scientific domain, geographical region).A cluster of RIs may be supported in some way or funded, e.g.byindustry entities. A cluster is modelled in CERIF asa virtual organisationthroughthe cfOrgUnit entity connected withthe individualRIs belongingtothe clusterwithacfOrgUnit_Facillinkentity.',NULL,'ORIGINAL',51,'en',339),(462,'Digital Object Identifier',NULL,'ORIGINAL',56,'en',462),(463,'PubMed Central ID',NULL,'ORIGINAL',56,'en',463),(464,'ISI Web Of Knowledge Number',NULL,'ORIGINAL',56,'en',464),(465,'Scopus Affiliation Identifier',NULL,'ORIGINAL',56,'en',465),(466,'Scopus Author Identifier',NULL,'ORIGINAL',56,'en',466),(467,'Open Researcher & Contributor ID',NULL,'ORIGINAL',56,'en',467),(468,'HESA Institution Identifier',NULL,'ORIGINAL',56,'en',468),(469,'HESA Staff Identifier',NULL,'ORIGINAL',56,'en',469),(470,'HESA Student Identifier',NULL,'ORIGINAL',56,'en',470),(472,'UK Provider Reference Number',NULL,'ORIGINAL',56,'en',472),(473,'Uniform Resource Identifier',NULL,'ORIGINAL',56,'en',473),(474,'Uniform Resource Locator',NULL,'ORIGINAL',56,'en',474),(475,'The ID as recorded in the HR system.',NULL,'ORIGINAL',56,'en',475),(476,'The ID as recorded in the project management system',NULL,'ORIGINAL',56,'en',476),(477,'The ID as recorded in the repository.',NULL,'ORIGINAL',56,'en',477),(478,'The ID as recorded in the finance system.',NULL,'ORIGINAL',56,'en',478),(479,'The ID as recorded in the CRIS.',NULL,'ORIGINAL',56,'en',479),(480,'Diari-Number in Sweden.',NULL,'ORIGINAL',56,'en',480),(481,'International Standard Name Identifier',NULL,'ORIGINAL',56,'en',481),(482,'Unique Universal Identifier',NULL,'ORIGINAL',56,'en',482),(483,'The Handle System provides efficient, extensible, and secure resolution services for unique and persistent identifiers of digital objects, and is a component of CNRI\'s Digital Object Architecture. Digital Object Architecture provides a means of managing digital information in a network environment. A digital object has a machine and platform independent structure that allows it to be identified, accessed and protected, as appropriate. A digital object may incorporate not only informational elements, i.e., a digitized version of a paper, movie or sound recording, but also the unique identifier of the digital object and other metadata about the digital object. The metadata may include restrictions on access to digital objects, notices of ownership, and identifiers for licensing agreements, if appropriate.',NULL,'ORIGINAL',56,'en',483),(491,'A course originating in the Education context is considered a type of service, therefore applicable in the cfSrv_Class link entity. Furthermore, a course presentation is considered an event, hence cfEvent_Class. The series of events linked to a service define the temporal manifestation of the service, which is thus',NULL,'ORIGINAL',58,'en',491),(497,'In CERIF, the concept of project is physically (cfProj) and logically (cfProject) defined as an entity in an ERM, represented by basic attributes and through maintaining relationships with other entities: projects (cfProj_Proj), classification systems (cfProj_Class), persons (cfProj_Pers), indicators (cfProj_Indic), measurements (cfProj_Meas). In the CERIF vocabulary, we introduce the concept of project. In the physical CERIF data model, the classification of types for projects happens with the cfProj_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning project types to project records.','CERIF Task Group','ORIGINAL',61,'en',497),(503,'In CERIF, the concept of organisation is physically (cfOrgUnit) and logically (cfOrganisationUnit) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. person (cfPers_OrgUnit), events (cfOrgUnit_Event), classification systems (cfOrgUnit_Class), projects (cfProj_OrgUnit). In the CERIF vocabulary, we introduce the concept of organisation. In the physical CERIF data model, the classification of types for organisations happens with the cfOrgUnit_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning organisation types to organisation records.','CERIF Task Group','ORIGINAL',62,'en',503),(504,'In CERIF, the concept of Facility (also Research Facility) is physically (cfFacil) and logically (cfFacility) defined as an entity in an ERM, described through basic attributes and through semantically neutral relationships with e.g. persons (cfPers_Facil), organisations (cfOrgUnit_Facil), classification systems (cfFacil_Class), projects (cfProj_Facil). In the physical CERIF data model, the classification of types for facility happens with the cfFacil_Class entity, where a type is represented by a classification term (cfTerm) identified by its cfClassificationIdentifier (a uuid), and reused at instance level for assigning facility types to facility records.\"','CERIF Task Group','ORIGINAL',62,'en',504);
INSERT INTO `cfclassex` VALUES (1,'A project in business and science is typically defined as a collaborative enterprise, frequently involving research or design, that is carefully planned to achieve a particular aim. Projects can be further defined as temporary rather than permanent social systems that are constituted by teams within or across organizations to accomplish particular tasks under time constraints.','http://en.wikipedia.org/wiki/Project','ORIGINAL',1,'en',2),(2,'A project in business and science is typically defined as a collaborative enterprise, frequently involving research or design, that is carefully planned to achieve a particular aim. Projects can be further defined as temporary rather than permanent social systems that are constituted by teams within or across organizations to accomplish particular tasks under time constraints.','http://en.wikipedia.org/wiki/Project','ORIGINAL',61,'en',497),(3,'Organising an event (e.g conference) (Activity Subtype).','RMAS Vocabulary','ORIGINAL',1,'en',3),(4,'Organising an event (e.g conference) (Activity Subtype).','RMAS Vocabulary','ORIGINAL',62,'en',503),(5,'The costs associated with the purchase of equipment normally above a price threshold, e.g 1.000 GBP (Activity Finance Category). The specification, procurement and installation of equipment Activity Subtype).','RMAS Vocabulary','ORIGINAL',1,'en',9),(6,'The costs associated with the purchase of equipment normally above a price threshold, e.g 1.000 GBP (Activity Finance Category). The specification, procurement and installation of equipment Activity Subtype).','RMAS Vocabulary','ORIGINAL',17,'en',98),(7,'The specification, procurement and installation of a service or the maintenance of existing equipment, facilities and buildings.','RMAS Vocabulary','ORIGINAL',1,'en',10),(8,'http://mice.cerch.kcl.ac.uk/?p=71','http://mice.cerch.kcl.ac.uk/?p=15; http://en.wikipedia.org/wiki/Performance_indicator','ORIGINAL',1,'en',19),(9,'http://mice.cerch.kcl.ac.uk/?p=71','