utions to the teaching of practical skills, they help to educate students (http://www.kcl.ac.uk/sspp/departments/management/people/academic/lewisgatsbyreport.pdf).','http://www.jcpsg.ac.uk/guidance/','ORIGINAL',34,'en',247),(19,'Doctor of Philosophy, abbreviated to PhD, or Ph.D. in English-speaking countries, for the Greek   (Latin philosophiae doctor). Here /philosophy, literally translating t \"the love of wisdom\", is used in the original Greek sense, loosely meaning \"the pursuit of in depth knowledge\" and does not refer to the scientific field philosophy.','http://en.wikipedia.org/wiki/Doctor_of_Philosophy','ORIGINAL',32,'en',219),(20,'Doctor of Philosophy, abbreviated to PhD, or Ph.D. in English-speaking countries, for the Greek   (Latin philosophiae doctor). Here /philosophy, literally translating t \"the love of wisdom\", is used in the original Greek sense, loosely meaning \"the pursuit of in depth knowledge\" and does not refer to the scientific field philosophy.','http://en.wikipedia.org/wiki/Doctor_of_Philosophy','ORIGINAL',34,'en',250),(21,'Principal Investigator is also called Promoter.',NULL,'ORIGINAL',34,'en',252),(22,'The person not directly involved in the activity but contributing to maintaining the infrastructure. ','RMAS Vocabulary','ORIGINAL',6,'en',53),(23,'The person not directly involved in the activity but contributing to maintaining the infrastructure. ','RMAS Vocabulary','ORIGINAL',31,'en',181),(24,'The person not directly involved in the activity but contributing to maintaining the infrastructure. ','RMAS Vocabulary','ORIGINAL',34,'en',257),(25,'The lead partner in a consortium.','RMAS Vocabulary','ORIGINAL',23,'en',130),(26,'The lead partner in a consortium.','RMAS Vocabulary','ORIGINAL',34,'en',259),(27,'e.g. first author, second author ... of a publication','CERIF Task Group','ORIGINAL',35,'en',271),(28,'e.g. 50% author of a publication','CERIF Task Group','ORIGINAL',35,'en',272),(29,'The organisation that wishes the work to be under