RIF Task Group','ORIGINAL',12,'en',85),(47,'A relationship.','CERIF Task Group','ORIGINAL',13,'en',87),(48,'A relationship.','CERIF Task Group','ORIGINAL',14,'en',88),(49,'A relationship.','CERIF Task Group','ORIGINAL',15,'en',91),(50,'A relationship.','CERIF Task Group','ORIGINAL',16,'en',96),(51,'','An authority to issue an identifier.','ORIGINAL',22,'en',124),(52,'','An authority to issue an identifier.','ORIGINAL',48,'en',323),(53,'1) An unconditional offer made by one to another to enter into the contract of transaction of goods or services at certain specified cost. Normally government bodies and business groups issues notices for quotes for specified goods or services from other businesses which is known as tender. 2) act of offering money or settlement for any dues or claims.','http://www.legal-explanations.com/definitions/tender.htm','ORIGINAL',57,'en',487),(54,'An example of intergovernmental organisation is FAO (Food and Agriculture Organization)','http://en.wikipedia.org/wiki/List_of_intergovernmental_organizations','ORIGINAL',53,'en',436),(55,'called Encyclopedia entries in CASRAI Dictionary',NULL,'ORIGINAL',52,'en',351),(56,'called Conference Paper in CASRAI Dictionary',NULL,'ORIGINAL',52,'en',359),(57,'called Dissertation in CASRAI Dictionary.',NULL,'ORIGINAL',52,'en',363),(58,'','http://purl.org/ntk/gltype#report','ORIGINAL',52,'en',364),(59,'called Newspaper Article in CASRAI Dictionary',NULL,'ORIGINAL',52,'en',368),(60,'An annotation is a brief note, usually no longer than two or three sentences, added after a citation in a bibliography to describe or explain the content or message of the work cited or to comment on it. ','http://lu.com/odlis/odlis_A.cfm#annotation','ORIGINAL',52,'en',370),(61,'Rendering the characters of one alphabet in characters representing the same sound (or sounds) in another alphabet (example: Greek or Cyrillic into Roman). Each character is treated independently of the others.','http://lu.com/odlis/odlis_A.cfm#transliteration','ORIGINAL',52,'en',371),(62,'A passage from a speech or written work, or an entire speech or work, put into the words of another language (English into Spanish) or into a more modern form of the same language (Old English or Middle English into contemporary English), usually to make the text more accessible to individuals who are unable to read it in the original language. Translations differ in the degree to which they follow the original. The name of the translator usually appears on the title page of a book, following the name of the author. A translation may have a parallel title in the source language. In library cataloging, the note Translation of: is added in the bibliographic description, giving the title in the original language.','http://lu.com/odlis/odlis_A.cfm#translation','ORIGINAL',52,'en',372),(63,' ',NULL,'ORIGINAL',52,'en',373),(64,' ',NULL,'ORIGINAL',52,'en',374),(65,'One of two ore more major divisions of a book or other work, each complete in itself but related in theme or plot to the division preceding and/or following it. In works of nonfiction, chapters are usually given a chapter title, but in works of fiction they may simply be numbered, usually in roman numerals. Chapters are listed in order of appearance by title and/or number in the table of contents in the front matter of a book.','http://www.abc-clio.com/ODLIS/odlis_c.aspx#chapter','ORIGINAL',52,'en',375),(66,' ',NULL,'ORIGINAL',52,'en',376),(67,' ','http://dictionary.casrai.org/search/Conference','ORIGINAL',52,'en',377),(68,'Something made or given shape by man, such as a tool or a work of art, esp an object of archaeological interest.','http://www.thefreedictionary.com/artefact','ORIGINAL',52,'en',379),(69,' ',NULL,'ORIGINAL',52,'en',380),(70,'called Performance Art in CASRAI Dictionary',NULL,'ORIGINAL',52,'en',381),(71,'called Artistic Exhibition in CASRAI Dictionary',NULL,'ORIGINAL',52,'en',382),(72,'called intellectual property in CASRAI: Collection of information records that, in combination, represent a full and up-to-date history of the intellectual property owned by the person and resulting from, or related to, the person\'s research activities.','http://dictionary.casrai.org/research-personnel-profile/contributions/outputs/intellectual-property','ORIGINAL',52,'en',383),(73,' ','http://dictionary.casrai.org/search/Composition','ORIGINAL',52,'en',384),(74,' ','http://dictionary.casrai.org/search/Design','ORIGINAL',52,'en',385),(75,' ',NULL,'ORIGINAL',52,'en',386),(76,' ',NULL,'ORIGINAL',52,'en',387),(77,' ',NULL,'ORIGINAL',52,'en',388),(78,'A website is a collection of related web pages, images, videos or other digital assets that are addressed relative to a common Uniform Resource Locator (URL), often consisting of only the domain name, or the IP address, and the root path (\'/\') in an Internet Protocol-based network. A web site is hosted on at least one web server, accessible via a network such as the Internet or a private local area network.','http://purl.org/ntk/gltype#website','ORIGINAL',52,'en',389),(79,' ',NULL,'ORIGINAL',52,'en',390),(80,'called Data set in CASRAI',NULL,'ORIGINAL',52,'en',391),(81,' ',NULL,'ORIGINAL',52,'en',392),(82,'','MERIL project','ORIGINAL',51,'en',336),(83,'','MERIL project','ORIGINAL',51,'en',337),(84,'','MERIL project','ORIGINAL',51,'en',338),(85,'','MERIL project','ORIGINAL',51,'en',339),(86,'','MERIL project','ORIGINAL',51,'en',340),(87,'','MERIL project','ORIGINAL',26,'en',151),(88,'','MERIL project','ORIGINAL',24,'en',143),(89,'','MERIL project','ORIGINAL',26,'en',152),(90,'(eg. the Research Organisation)','MERIL project','ORIGINAL',21,'en',118),(91,'(eg. the Research Organisation)','MERIL project','ORIGINAL',26,'en',153),(92,'(eg. the Research Organisation)','MERIL project','ORIGINAL',30,'en',174),(93,'','MERIL project','ORIGINAL',30,'en',175),(94,'','MERIL project','ORIGINAL',21,'en',119),(95,'','MERIL project','ORIGINAL',21,'en',120),(96,'','MERIL project','ORIGINAL',39,'en',308),(97,'','MERIL 